    };
  }


  // componentDidMount() {
  //   this.fetchData();
  // }


  render() {
    return (
      <div className="App">
        <div className="App__Aside">
          <div className="App__Form">
            <div className="PageSwitcher">
              <h3>Join the club</h3>
              <a href="Registered member" className="PageSwitcher__item">Sign in</a>

              <a href="Registered member" className="PageSwitcher__item PageSwitcher__Item Active">Sign Up</a>

              <div>
                <h1>Welcome to staycation</h1>
                <p>where luxurious vacation is is just a click away</p>
              </div>
              <div>

              </div>
            </div>
          </div>
        </div>
      </div>


    );
  }
}


export default App;
